import React, { Component } from 'react';
import Navbar from './Components/Navbar';
import Routes from './Components/Routes';
import Footer from './Components/Footer';

class App extends Component {
  render() {

    return (
      <div className = "app">
      <Navbar />
      <Routes />
      <div className="footer-content">
      <Footer />
      </div>

      </div>

    )
  }
} 


export default App;
